Templates.template:
deleteChange(
	{
		sChangeName: ${sChangeName}, // String
		sLayer: ${sLayer}, // String
		sNamespace: ${sNamespace}, // String
		sChangelist: ${sChangelist} // String
	},
	"${bIsVariant}" // Boolean
)

loadChanges(
	{
		name: "${name}", // string
		appVersion: "${appVersion}" // string
	},
	{
		appDescriptor: ${appDescriptor}, // object
		siteId: "${siteId}", // string
		layer: "${layer}", // string
		appVersion: "${appVersion}", // string
		url: "${url}" // string
	}
)

create_app_addAnnotationsToOData(
	{
		dataSourceId: "${dataSourceId}", // string
		annotations: [${annotations}], // array
		annotationsInsertPosition: ${annotationsInsertPosition}, // enum
		dataSource: ${dataSource} // object
	}
)

create_app_changeInbound(
	{
		inboundId: "${inboundId}", // string
		entityPropertyChange: [${entityPropertyChange}] // object|array
	},
	"${mTexts}" // object
)

create_app_setDescription(
	{
		maxLength: ${maxLength}, // object
		type: ${type}, // object
		comment: ${comment}, // object
		value: ${value} // object
	}
)

create_app_setInfo(
	{
		maxLength: ${maxLength}, // object
		type: ${type}, // object
		comment: ${comment}, // object
		value: ${value} // object
	}
)

create_app_setShortTitle(
	{
		maxLength: ${maxLength}, // object
		type: ${type}, // object
		comment: ${comment}, // object
		value: ${value} // object
	}
)

create_app_setSubTitle(
	{
		maxLength: ${maxLength}, // object
		type: ${type}, // object
		comment: ${comment}, // object
		value: ${value} // object
	}
)

create_app_setTitle(
	{
		maxLength: ${maxLength}, // object
		type: ${type}, // object
		comment: ${comment}, // object
		value: ${value} // object
	}
)

create_ovp_addNewCard(
	{
		card: ${card}, // object
		model: ${model}, // object
		dataSource: ${dataSource} // object
	},
	"${mTexts}" // object
)

create_ovp_changeCard(
	{
		cardId: "${cardId}", // string
		entityPropertyChange: [${entityPropertyChange}] // object|array
	},
	"${mTexts}" // object
)

new sap.ui.fl.descriptorRelated.api.DescriptorVariant(
	{
		id: "${id}", // string
		reference: "${reference}", // string
		isAppVariantRoot: ${bIsAppVariantRoot} // boolean
	},
	"${mFileContent}", // object
	"${bDeletion}", // boolean
	"${oSettings}" // sap.ui.fl.registry.Settings
)

createNew(
	{
		reference: "${reference}", // string
		id: "${id}", // string
		layer: "${layer}", // string
		isAppVariantRoot: ${bIsAppVariantRoot} // boolean
	}
)

fireSave(
	{
		name: "${name}", // string
		overwrite: ${bOverwrite}, // boolean
		key: "${key}", // string
		execute: ${bExecute}, // boolean
		def: ${bDef} // boolean
	}
)
